        scribbleUrl: '',
        scribble: "It has been 50 years since the rare white-eyed river Martin was first spotted in Thailand, a bird seen so infrequently it is nearly mythical.<br><br>Known locally as the Princess Sirindhorn bird, the white-eyed Martin is one of only two species of birds native to Thailand. This unique Thai treasure is distinguished by gleaming green-black feathers, a white midsection and a tail extending into two delicate black feathers. <br><br>Its beauty is hard to find, with only three confirmed sightings since it was first discovered at a wintering site in 1968. The Thai government has honored the mystical species with a stamp and commemorative coin, meant to pique curiosity and raise awareness of the bird.<br><br>No one has spotted the Princess Sirindhorn since 1980, stoking unconfirmed speculation that the species has gone extinct. That won\u2019t stop residents and tourists alike this spring from perusing river banks, where the rare bird is known to roost, in the hopes that they\u2019ll spot this rare Thai jewel!",
